import primera from '../../Img/primera.jpeg'
import segunda from '../../Img/segunda.jpeg'

export default [
    {
        titulo : 'hola 1',
        descrip : 'soy el descrip 1',
        vinculo : 'facebook.com',
        img : primera,
    },
    {
        titulo : 'hola 2',
        descrip : 'soy el descrip 2',
        vinculo : 'facebook.com',
        img : segunda,
    }
];
